import React, { ReactElement } from 'react';
import { Portfolio } from './interfaces';
import Stock from './PaperTrade';


interface PortfolioDetailProps {
    portfolio: Portfolio;
}

function PortfolioDetails ({portfolio}: PortfolioDetailProps): ReactElement {
    return (
        <div>
            <div>
                Your Portfolio: {portfolio.name}
                <br></br>
                Cash: {portfolio.cash}
                <br></br>
                Your stocks:
                {portfolio.stocks.map((stock) => (
                    stock.ticker
                ))}
            </div>

            <div id="searchFormDiv">
                <form id="searchForm">
                    <label for="tickerInput">Ticker:</label>
                    <br></br>
                    <input type="text" id="tickerInput" name="tickerInput"/>
                    <input type="submit" value="Submit"/>
                </form>

                <p id="priceDisplay">
                    Price will show here
                </p>
                <form id="buyForm">
                    <label for="quantityInput">Quantity:</label>
                    <br></br>
                    <input type="text" id="quantityInput" name="quantityInput"/>
                    <input type="submit" value="Buy"/>
                </form>
            </div>
        </div>

    )
}



export default PortfolioDetails;
